    false,nt"url": null,nt"notes": "<p>The SKR Project was initiated at NLM
    in order to develop programs to provide usable semantic representation of biomedical
    free text by building on resources currently available at the library. The SKR project
    is concerned with reliable and effective management of the information encoded in
    natural language texts. The project develops programs that provide usable semantic
    representation of biomedical text by building on resources currently available at
    the Library, especially the UMLS knowledge sources and the natural language processing
    tools provided by the SPECIALIST system.  This Java-based API to the Semantic Knowledge
    Representation (SKR) Scheduler facility was created to provide users with the ability
    to programmatically submit jobs to the Scheduler Batch and Interactive facilities
    instead of using the Web-based interface.</p>n",nt"license_title": "License
